import React, { useEffect, useState } from "react";
import "./Components.css";

class TableFilter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="filterBox">
        <h3>Filter</h3>
      </div>
    );
  }
}

function PrecisionFilter() {
  return (
    <div className="filterBox">
      <h3>Filter</h3>
    </div>
  );
}

export default TableFilter;
